import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="app-wrapper">
      <header className='header'>
      </header>
      <nav className="nav">
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
      </nav>
      <div className='content'>
        <div>
          <img src="https://www.ecotour.by/upload/resize_cache/iblock/cf8/833_463_2/ffca624d210df7f413076866d87353b7.jpeg" alt="Photo content"/>
        </div>
        <div>
          avatar
        </div>
      </div>
    </div>
  );
}

export default App;
